import logo from './logo.svg';
import React, { useContext, useEffect } from "react";
import './App.css';
import UserNavBar from './components/Navbar/UserNavBar';
import RegisterNavbar from './components/Navbar/RegisterNavbar';
import SignInNavbar from './components/Navbar/SignInNavbar';
import SignIn from './pages/signin-page/SignIn';
import SignUp from './pages/signup-page/SignUp';
import Home from './pages/home-page/home'
import CreateTopicPopup from './components/CreateTopicPopup';
import Profile from './pages/profile-page/Profile';
import EditProfile from './pages/edit-profile-page/EditProfile';
import FavDebateGallery from './pages/fav-debate-gallery/FavDebateGallery';
import EditPasswordPopup from './components/edit-user-password-popup/EditPasswordPopup';
import { BrowserRouter as  Router, Routes, Route ,  
  createBrowserRouter,
  RouterProvider,
  Navigate,
} from 'react-router-dom';
import { AuthContext } from './context/authContext';
import EditProfileData from './pages/edit-profile-data-page/EditProfileData';
import { makeRequest } from './axios';
import DebateTopic from './pages/debate-topic-page/DebateTopic';
import DownloadRequestList from './pages/dataset-download-list/DownloadRequestList';
import AdminNavBar from './components/Navbar/AdminNavBar';
import AdminSidemenu from './components/admin-sidemenu/AdminSidemenu';


function App() {

  const { currentUser } = useContext(AuthContext);
  
  /*useEffect(() => {
    if (currentUser && currentUser.role_id === "admin") {
      console.log("Current user:ตรงกัน");
    }
    else{
      console.log("ไม่ตรงกัน")
    }
  }, [currentUser]);*/

  const ProtectedRoute = ({ children, roles }) => {
    if (!currentUser) {
      return <Navigate to="/signin" />;
    } else if (roles && !roles.includes(currentUser.role_id)) {
      return <Navigate to="/signin" />;
    }
    return children;
  };


  
  return (
    <Router>
      <div className="App">
        <Routes>

          <Route path="/" element={
            <ProtectedRoute roles={['admin', 'user']}>
              {currentUser && currentUser.role_id === 'admin' ? 
              <>
              <Home />
              
              <AdminNavBar />
               
              </>
              : <Home />}
            </ProtectedRoute>
          } />


          <Route path="/profile" element={
            <ProtectedRoute roles={['admin', 'user']}>
              {currentUser && currentUser.role_id === 'admin' ? <Profile /> : <Profile />}
            </ProtectedRoute>
          } />

          <Route path="profile/me" element={
            <ProtectedRoute roles={['admin', 'user']}>
              {currentUser && currentUser.role_id === 'admin' ? <EditProfile /> : <EditProfile />}
            </ProtectedRoute>
          } />

          <Route path="profile/me/edit" element={
            <ProtectedRoute roles={['admin', 'user']}>
              {currentUser && currentUser.role_id === 'admin' ? <EditProfileData /> : <EditProfileData />}
            </ProtectedRoute>
          } />

          <Route path="profile/me/changepassword" element={
            <ProtectedRoute roles={['admin', 'user']}>
              {currentUser && currentUser.role_id === 'admin' ? <EditPasswordPopup /> : <EditPasswordPopup />}
            </ProtectedRoute>
          } />

          <Route path="profile/me" element={
            <ProtectedRoute roles={['admin', 'user']}>
              {currentUser && currentUser.role_id === 'admin' ? <EditProfile /> : <EditProfile />}
            </ProtectedRoute>
          } />

          <Route path="profile/me" element={
            <ProtectedRoute roles={['admin', 'user']}>
              {currentUser && currentUser.role_id === 'admin' ? <EditProfile /> : <EditProfile />}
            </ProtectedRoute>
          } />

          <Route path="/signin" element={<SignIn />} />
          <Route path="/signup" element={<SignUp />} />
          <Route path="/topic/:id" element={<DebateTopic />} />
          <Route path="/fav" element={<FavDebateGallery />} />
          <Route path="/downloadrequest" element={<DownloadRequestList />} />


        </Routes>
      </div>
    </Router>
  );
}

export default App;
